import React from "react";
import {Route, Switch, useRouteMatch, Link } from 'react-router-dom'; 

import Product from "../Product/Product";
import Inventory from "../Inventory/Inventory";
import Payment from "../Payment/Payment";
import Account from "../Account/Account";
import NavBar from "../../UI/NavBar/NavBar";

import styles from './AdminDashboard.module.css';
import { withRouter } from "react-router";

const AdminDashboard = (props) =>{
    let { path, url } = useRouteMatch();
    const navbar = [
        {
            id_num:1,
            id: "manage-products",
            path: '/manage-products',
            li: "Manage Products",
        },
        {
            id_num:2,
            id: "manage-inventory",
            path: '/manage-inventory',
            li: "Manage Inventory",
        },
        {
            id_num:3,
            id: "manage-payments",
            path: '/manage-payments',
            li: "Manage Payments",
        },
        {
            id_num:4,
            id: "manage-accounts",
            path: '/manage-accounts',
            li: "Manage Accounts",
        },
    ]

return(   

            <div className={`${styles.container}`}>

                <NavBar/>
                <ul>
                            <li>
                                <Link to={`${url}/add-product`}>Add Product</Link>
                            </li>
                            <li>
                                <Link to={`${url}/update-product`}>Update Product</Link>
                            </li>
                            <li>
                                <Link to={`${url}/delete-product`}>Delete Product</Link>
                            </li>
                </ul>

                    <Switch>
                    <Route exact path={["/dashboard/manage-product", "/dashboard", "/dashboard/add-product"]}>
                        <Route path="/dashboard/add-product">
                            <Product/>
                        </Route>
                    </Route>
                    <Route exact path="/dashboard/manage-inventory">
                        <Inventory/>
                    </Route>
                    <Route exact path="/dashboard/manage-payments">
                        <Payment/>
                    </Route>
                    <Route exact path="/dashboard/manage-accounts">
                        <Account/>
                    </Route>
                </Switch>
            </div>
)
}

export default withRouter(AdminDashboard);
